import React, { Component } from 'react';
import Content from './Content.js';
import './App.css';

class App extends Component {


  render() {

    const divStyle = {
      margin: '40px',
      border: '5px solid pink'
    };

    return (
      <React.Fragment>
        <div className='main animated fadeInBottom' style={divStyle}>
          <Content />
        </div>
      </React.Fragment>
    );
  }
}


export default App;
